import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  height: 20%;
  min-height: 100px;
  background-color: #f5f5f5;
  justify-content: space-between;
  align-items: center;

  ul {
    display: flex;
    margin: 0 30px 0 0;
  }

  ul li {
    list-style: none;
    margin: 0 10px 0 10px;
  }
  .logo {
    margin: 0 0 0 50px;
    font-size: 26px;
  }
  .logo:hover {
    cursor: pointer;
  }
`;
